caption";s:2041:"¿Porque nos cuesta tanto mostrarnos vulnerables ante las personas? ¿Porque nos cuesta tanto reconocer que somos débiles? ... porque hemos crecido creyendo que el ser débiles es malo, que si nos mostramos vulnerables fácilmente seremos heridos y juzgados, preferimos mostrar nuestra mejor careta, esa que es bonita ante los ojos de los demás, nuestro mejor porte, ese que refleja fuerza y poder, nos gusta alardear de nuestros logros y mostrarlos con orgullo a todos, pero nunca escucharas o veras a alguien sentirse feliz u orgulloso de ser débil. Pablo uno de los apostoles mas reconocidos de la biblia, tenia un sin fin de cosas y experiencias maravillosas por las cuales jactarse, pero el decide jactarse, presumir de sus debilidades, y aunque creo que no fue fácil para él, Dios le dice "Es en tu debilidad en donde mi poder se manifiesta" y el se alegraba y gozaba de mostrarse débil, de ser insultado, de tener necesidades, porque cuando mas vulnerable se sentia, mas fuerte era en Dios". Por mucho tiempo pedi a Dios que me hiciera mas fuerte, porque no me gustaba ser débil, llorar con facilidad, le suplicaba "Dios quiero un corazón mas fuerte uno que no sea fácil de lastimar" y usaba muchos mecanismos de defensa para que los demas vieran en mi una persona fuerte que todo lo podia, hasta que entendí que en mi debilidad Dios se manifestaba, que aun siendo débil podia sentirme fuerte porque él estaba en mi No hay nada de malo en sentirte débil y reconocer que lo eres, ser transparente, sentir que no puedes con todo, pues alli en donde todo parece ser malo Dios esta actuando el te dice.." Mi gracia es todo lo que necesitas; mi poder actua mejor en tu debilidad 2 Corintios 12:9 "
